    false,nt"url": null,nt"notes": "This report explains the effects of the
    1994 water levels on the ecology of  Montezuma National Wildlife Refuge and it proposes
    the water surface elevations of the five main impoundments on the refuge for 1995.
    The report outlines the reasoning behind these proposals. Despite the flooding problems
    early in the year, 1994 was not a total loss concerning impoundment management.
    Although some efforts largely were unsuccessful on a large- scale because of complications,
    the strategies implemented indicated that the potential exists to improve refuge
    habitats. Foremost was the indication that seed banks of desirable vegetation are
    present in many refuge impoundments. Lessons learned in 1994 will guide water level
    management on the refuge in future years.",nt"license_title": "License Not
